-- Table structure for ims_thesis_topic
-- ----------------------------
DROP TABLE IF EXISTS `ims_thesis_topic`;
CREATE TABLE `ims_thesis_topic`  (
  `topic_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '论文编号',
  `user_id` int NULL DEFAULT NULL COMMENT '用户ID',
  `teacher_id` int NULL DEFAULT NULL COMMENT '导师ID',
  `dept_id` int NULL DEFAULT NULL COMMENT '所属院系',
  `task_id` int NULL DEFAULT NULL COMMENT '任务ID',
  `topic_title` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '课题',
  `topic_source` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '题目来源\r\n0-导师拟定\r\n1-科研项目 \r\n2-学生自行拟定',
  `topic_type` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '题目类型',
  `topic_desc` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '课题描述',
  `topic_status` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '课题状态\r\n0-未选中                          \r\n1-学生已提交课题，等待导师审批                      \r\n2-未通过导师审批，等待学生修改                     \r\n3-导师审批通过，等待学院审批                        \r\n4-未通过学院审批，等待学生修改                      \r\n5-学院已审批此课题，等待学生提交开题报告                6-开题报告已提交，等待学生提交中期检查                    7-中期检查已提交，等待学生提交论文                  \r\n8-论文已提交                      \r\n9-结束',
  `subject_category` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '学科门类\r\n0-工学 \r\n1-哲学 \r\n2-经济学 \r\n3-法学 \r\n4-教育学 5-文学 \r\n6-历史学 \r\n7-理学 \r\n8-农学\r\n9-医学 \r\n10-军事学 \r\n11-管理学\r\n12-艺术学',
  `subject_type` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '课题类型\r\n0-工程设计\r\n1-理论研究\r\n2-实验研究\r\n3-软件工程\r\n4-文献型综述\r\n5-其他类型',
  `del_flag` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '删除状态',
  `create_dept` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建院系',
  `create_by` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建者',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '更新者',
  `update_time` datetime NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`topic_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

