INSERT INTO `ims_enterprise_info` VALUES (3, '小熊科技', '<p><span style=\"color: rgb(97, 104, 124);\">小熊科技拥有11000余名员工，业务遍布全国30余省。作为中国电信软件产品及相关服务的领军企业，凭借着对行业的深刻理解与优质的项目管理能力，提供了高性能、专业化、高可靠的电信级软件产品和优质服务。同时，亚信科技积极拓展非电信行业市场，大型企业客户涉及能源、广电、邮政、金融、保险、汽车等行业，在智慧社区、智慧零售、车联网、公共服务等领域均有创新实践。</span></p><p><span style=\"color: rgb(97, 104, 124);\">亚信科技将结合人工智能、机器学习、物联网、大数据等技术，助力各行业客户数字化转型，推动“数字中国”深入发展。</span></p>', '湖南省长沙市雨花区', 'internship', '2021-01-30 00:00:00', '1', '4', 'internship', '18356478956', '545645644@qq.com', '', NULL, '0', '0', '1', '计算机科学与技术学院', 'admin', '2021-02-02 19:47:54', 'admin', '2021-02-02 19:48:09');
INSERT INTO `ims_enterprise_info` VALUES (4, '湖南兴盛优选电子商务有限公司', '<p><span style=\"color: rgb(97, 104, 124);\">湖南兴盛优选电子商务有限公司（简称兴盛优选），注册地为湖南长沙市高新开发区，入选国家商务部首批“线上线下融合发展数字商务企业”,入围“2019年中国独角兽企业”和“2020胡润全球独角兽榜”。</span></p><p><span style=\"color: rgb(97, 104, 124);\">兴盛优选是一家关注民生的互联网“新零售”平台，也是湖南省第一家估值超过10亿美金的“独角兽”企业。平台主要定位是解决家庭消费者的日常需求，提供包括蔬菜水果，肉禽水产，米面粮油，日用百货等全品类精选商品。依托社区实体便利店，通过“预售+自提”的模式为用户提供服务.</span></p>', '长沙市 岳麓区 长沙芯城科技园2期 ', '岳立华', '2018-01-12 00:00:00', '4', '1', '小明', '15678945612', '23214214@qq.com', '23214214', NULL, '0', '0', '1', '计算机科学与技术学院', 'admin', '2021-02-02 20:03:30', 'admin', '2021-02-02 20:11:10');
