INSERT INTO `ims_enterprise_post` VALUES (3, 'JAVA架构师', 3, '<p><span style=\"color: rgb(97, 104, 124);\">1、统招本科及以上学历，8年以上进行产品设计经验； 2、精通java开发的生态技术，包含各种开源的组件,例如前端vuejs，jquery,react等，后端spring等 3、熟悉微服务开发的框架，例如spring cloud，dubbo 4、熟悉分布式和流处理技术开发，例如storm ,flink等 5、熟悉各种大数据组件的应用开发，例如hadoop,redis,kafka,spark，es等 6、熟练使用关系型数据，熟练使用sql,并了解sql的优化 7、有带领团队经验，有行业基础优先。</span></p>', '3', '<p><span style=\"color: rgb(97, 104, 124);\">1. 负责IOP（集中运营平台）产品的整体规划设计；</span></p><p><span style=\"color: rgb(97, 104, 124);\">2. 带领开发团队密切协作，把控需求，控制变更，并对成果物进行负责；</span></p><p><span style=\"color: rgb(97, 104, 124);\">3. 配合产品推广宣传，包括市场推广材料编制，及与用户的需求交流、产品方案制定等；</span></p><p><span style=\"color: rgb(97, 104, 124);\">4. 负责电信运营商行业运营项目的售前方案、客户交流及项目投标等，积极拓展新市场、新项目。</span></p><p><span style=\"color: rgb(97, 104, 124);\">5. 负责产品项目交付的指导，跟踪和协调，对项目交付结果负责</span></p>', '4', '120000', '不包吃住', 20, '0', '计算机科学与技术学院', 'admin', '2021-02-02 19:54:04', 'admin', '2021-02-04 09:19:28');
