INSERT INTO `ims_practice_weekly` VALUES (1, 132, 1, '0', '专业实习周记', '<p>	这周主要是熟悉了央行评价管理系统的业务需求的具体业务流程，年度专业评价、季度评价、评级评查、高风险机构管理、知识库的具体业务流程以及一些具体的细节，项目经理对业务方面内容的掌握程度进行小考察；同时学习了Linux的常用指令，Java编译的命令，Tomcat的运行停止等，文件的增删改查移，文本的查看编辑；<span style=\"color: rgb(51, 51, 51);\">熟悉了一下eclipse的基本操作；简单看了一下若依权限管理系统的文档以及源码；</span></p><p>	<span style=\"color: rgb(51, 51, 51);\">复习了Linux的基本指令，并进行了实操；同时也回顾了一下央行评价管理系统的具体业务流程，用eclipse进行了Spring Boot整合了Mybatis框架，并进行了简单的CURD测试；Linux指令中Java编译遇到了进行总结与解决；</span></p>', '不错', '1', '2021-03-05 00:00:00', '2021-03-06 00:00:00', '1', '0', '1', '2017级一班', '17690133', '2021-03-05 20:40:13', '17690133', '2021-03-05 21:37:41');
INSERT INTO `ims_practice_weekly` VALUES (2, 132, 1, '0', '专业实习周记', '<p>	这周简单查看了一下人行评分系统的整体流程说明；部署了若依权限管理系统；每天学习一道算法；用eclipse进行了spring Boot整合shiro框架；看了若依权限管理系统数据库的设计以及登录模块的代码和用户管理源码以及数据库关于权限的设计；</p><p>	简单复习了Mybatis持久层框架，复习并操作了mysql的基本命令，spring boot整合mybatis框架，通过xml配置进行增删改查解决了自己个人博客页面导航栏显示问题 重新编写了博客的标签与分类页面，复习了thymeleaf模板引擎如何使用。</p><p><span style=\"background-color: rgb(255, 255, 255);\">学习了Spring Boot + vue前后端分离开发的概述部分；同时了解了一下SVN版本控制工具；进行了项目相关的学习，如何部署若依前后端分离后台系统 下午:在win安装了Redis；学习了SpringBoot+vue前后端分离开发。</span></p>', '不错哦！', '1', '2021-03-06 00:00:00', '2021-03-07 00:00:00', '2', '0', '1', '2017级一班', '17690133', '2021-03-05 20:40:42', '17690125', '2021-03-05 20:46:10');
INSERT INTO `ims_practice_weekly` VALUES (3, 132, 1, '0', '专业实习周记', '<p>	这周主要是用RuoYi-Vue的框架进行简单选课系统的开发，同时我们进行了项目框架的培训。</p><p>	在原有若依权限管理系统的基础上新增了学生选课系统，按照学生选课系统一步一步的进行设计，从需求--&gt;功能--&gt;数据库的设计--&gt;具体的实现。在完成这个小任务的过程中遇到了一些困难，比如权限的控制，ID转换为名称等等；但最终还是完成个人的学生选课系统。有一点点成就感，同时也帮我复习了Spring Boot的开发；</p><p><span style=\"background-color: rgb(255, 255, 255);\">团队任务是需要我们共同完成的，但我们每个人都完成了一份。同时也学习了Vue框架以及如何使用。</span></p>', NULL, '1', '2021-03-07 00:00:00', '2021-03-08 00:00:00', '3', '0', '1', '2017级一班', '17690133', '2021-03-05 20:41:05', NULL, '2021-03-05 20:41:05');
INSERT INTO `ims_practice_weekly` VALUES (4, 132, 1, '0', '专业实习周记', '<p class=\"ql-align-justify\">	这周我们项目组对项目开展了相关会议，进行设计阶段的各个模块的任务分配和计划完成时间。</p><p class=\"ql-align-justify\">	首先看到属于的部分，对自己的任务进行了简单的了解，简单设计了相关表的数据库，同时一些比较复杂或者设计不合理的地方，项目经理对复杂的数据库设计进行了分析，该如何去设计数据库表，以什么原则，很后悔当初没有好好学习数据库概述这门课程，书到用时方恨少。</p><p class=\"ql-align-justify\">	期间开会汇报了我们的设计阶段的进度，同时说明了一些情况，比如项目框架进行了调整。</p><p class=\"ql-align-justify\">	这周主要是详细设计阶段，包括接口以及数据库设计，同时也学会了用Visio画了接口的流程图，如何编写接口文档以及详细设计文档等。</p>', NULL, '1', '2021-03-08 00:00:00', '2021-03-09 00:00:00', '4', '0', '1', '2017级一班', '17690133', '2021-03-05 20:41:31', '17690133', '2021-03-05 20:57:56');
INSERT INTO `ims_practice_weekly` VALUES (5, 100, 2, '0', '专业实习周记', '<p class=\"ql-align-justify\">	这周主要是对上周编写的详细设计文档以及接口文档设计不合理的地方就行修改以及调整。</p><p class=\"ql-align-justify\">	主要就是跟自己相应的模块有关的进行了交流，讨论接口的设计以及具体详细问题，同时也对自己负责的模块的详细设计进行了简单汇报。</p><p><span style=\"background-color: rgb(255, 255, 255);\">首先，根据详细设计文档进行了简单的测试，主要是利用了若依系统进行了代码生成，导入至系统里，进行兼容或测试，同时项目经理对我负责的部分的数据表以及接口进行剖析，提出了我设计不对的地方以及问题；编写了相应的接口，现在感觉就是接口文档很重要，虽然不可能一直按照接口文档来。12</span></p>', 'nice', '1', '2021-03-01 00:00:00', '2021-03-03 00:00:00', '1', '0', '1', '2017级一班', '17690136', '2021-03-06 14:57:52', '17690136', '2021-04-20 16:39:41');
INSERT INTO `ims_practice_weekly` VALUES (8, 100, 2, '1', '专业实习周记', '<p class=\"ql-align-justify\">	这周主要是解决导出数据到Excel并把相同的内容进行合并。</p><p class=\"ql-align-justify\">	首先还是跟之前一样，对以前写的接口进行修改以及完善，接口的描述以及业务层的注释，同时也会对已写的接口进行了简单的单元测试，以及会对有问题的脚本以及逻辑进行了修改。</p><p><span style=\"background-color: rgb(255, 255, 255);\">首先对导出一开始没有思路，因为怎么上传就怎么导出，而且内容不一样，相同内容就进行合并，查找导出为Excel的相关资料，用easyExcel进行数据的导出测试，对已写接口进行测试。找了一上午的资料，也用了填充，还是一无所获，后面发现一个可以，但是这个导出测试只适用于没有List、Map以及对象的实体类，但这个导出是连表的，存在这种情况，后面问了公司的大佬，用Mybatis的继承，解决了这个问题。</span></p>', NULL, '1', '2021-03-01 00:00:00', '2021-03-31 00:00:00', '99', '0', '0', '2017级一班', '17690136', '2021-03-06 15:19:32', '17690136', '2021-03-06 15:22:22');
INSERT INTO `ims_practice_weekly` VALUES (9, 100, 2, '0', '专业实习周记', '<p class=\"ql-align-justify\">	这周主要是对上周编写的详细设计文档以及接口文档设计不合理的地方就行修改以及调整。</p><p class=\"ql-align-justify\">	主要就是跟自己相应的模块有关的进行了交流，讨论接口的设计以及具体详细问题，同时也对自己负责的模块的详细设计进行了简单汇报。</p><p>	首先，根据详细设计文档进行了简单的测试，主要是利用了若依系统进行了代码生成，导入至系统里，进行兼容或测试，同时项目经理对我负责的部分的数据表以及接口进行剖析，提出了我设计不对的地方以及问题；编写了相应的接口，现在感觉就是接口文档很重要，虽然不可能一直按照接口文档来。</p>', NULL, '0', '2021-04-20 00:00:00', '2021-04-20 00:00:00', '1', '0', '0', '2017级一班', '17690136', '2021-04-20 16:35:47', 'admin', '2022-11-06 17:44:16');
INSERT INTO `ims_practice_weekly` VALUES (10, 100, 2, '0', '专业实习周记', '<p class=\"ql-align-justify\">	这周主要是对上周编写的详细设计文档以及接口文档设计不合理的地方就行修改以及调整。</p><p class=\"ql-align-justify\">	主要就是跟自己相应的模块有关的进行了交流，讨论接口的设计以及具体详细问题，同时也对自己负责的模块的详细设计进行了简单汇报。</p><p>	首先，根据详细设计文档进行了简单的测试，主要是利用了若依系统进行了代码生成，导入至系统里，进行兼容或测试，同时项目经理对我负责的部分的数据表以及接口进行剖析，提出了我设计不对的地方以及问题；编写了相应的接口，现在感觉就是接口文档很重要，虽然不可能一直按照接口文档来。</p>', NULL, '1', '2021-04-20 00:00:00', '2021-04-21 00:00:00', '1', '0', '1', '2017级一班', '17690136', '2021-04-20 16:36:19', NULL, '2021-04-20 16:36:19');
